import React from 'react';

handleClick = () => console.log('click');

const ToggleButton = () => {
	return (
		<button className="hamburger hamburger--vortex" type="button">
			<span className="hamburger-box">
				<span className="hamburger-inner"></span>
			</span>
		</button>
	);
};

export default ToggleButton;
